', "ford announced  that it would team up with electricity supply company southern california edison (sce) to examine the future of plug-in hybrids in terms of how home and vehicle energy systems will work with the electrical grid. under the multimillion-dollar, multi-year project, ford is to convert a demonstration fleet of ford escape hybrids into plug-in hybrids, and sce is to evaluate how the vehicles might interact with the home and the utility's electrical grid."]
